function gridOptions(rows, columns) {
    return {
        columnDefs: columns,
        rowData: rows,
        enableFilter: true,
        enableColResize: true,
        rowSelection: 'single',
        enableSorting: true
    }
}
function dynamicSize() {
    return {
        'width': window.innerWidth - 40,
        'height': Math.floor(window.innerHeight / 2)
    };
}

angular.module('app', ['ngTouch', 'agGrid', 'angularResizable'])
    .controller('AppController', function ($scope) {
        var rows = store(),
            columns = rows && rows.length ? model(rows[0]) : null;
        $scope.gridOptions = gridOptions(rows, columns);
        $scope.dynamicSize = dynamicSize();
        $scope.flexbox = true;
    });
